pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./Security.sol";
import "./SharedStructs.sol";


/*
    Error codes
    1: insufficient amount
    2: insufficient supply
    3: different gnome
    3: different level
    4: max level
    5: amount it to small
    6: gnome does not exists,
    7: gnome cool down
    8: only owner can do this action
 */

interface IRandom {
    function getRandomNumber() external returns (uint);
}

interface IGnomesTemplates is ISharedStructs {

    function getGnomeTemplateRarityAndRandom(uint rarity, uint randomNumber) external view returns (structGnome memory);

    function getCollectionById(uint id) external view returns (uint[] memory);

}

contract MyMiniMiners is ERC721, ERC721Enumerable, Security, ReentrancyGuard, ISharedStructs {


    /*
     [0] =  legendarySupplyLeft
     [1] =  EpicSupplyLeft
     [2] =  rareSupplyLeft
     [3] =  CommonSupplyLeft
    */

    uint[4] private _supplyLeft = [17500, 87500, 437500, 857500];

    string private _baseURIStr;

    structPlayerGnome[] private _playersGnomes;
    IRandom private _randomContract;
    IGnomesTemplates private _gnomesTemplatesContract;


    event Mint(address indexed player, uint  indexed tokenId, uint collection, uint8 gnomeId, uint8 level, uint8 rarity);
    //todo change to real
    //ERC721("My Mini Miners", "MYMM")
    constructor(address feesAccount, address adminAccount, address randomContract, address gnomesTemplatesContract, string memory baseUri)   ERC721("mmmt1", "MMMT1") ReentrancyGuard() payable {
        setFeesAccount(feesAccount);
        setAdminAccount(adminAccount);
        setGnomesTemplateContractAddress(gnomesTemplatesContract);
        setRandomContractAddress(randomContract);
        setBaseUri(baseUri);
        //solidity default value for uint is 0 so we start the tokenIds from 1
        _playersGnomes.push();
    }
    //********************************* game functions *************************************//

    function buyGnome(uint8 amountToBuy) external payable nonReentrant {
        require(msg.value == getGnomePrice(amountToBuy), "Insufficient amount");
        uint currentTotalSupply = totalSupplyLeft();
        require(currentTotalSupply >= amountToBuy, "Insufficient supply");
        payable(feesAccount()).transfer(msg.value);

        for (uint8 i; i < amountToBuy; i++) {
            uint randomNumber = _randomContract.getRandomNumber();
            uint randomPosition = randomNumber % currentTotalSupply;
            uint rarityIndex = _getRarityByPosition(randomPosition);
            _supplyLeft[rarityIndex]--;
            currentTotalSupply--;
            structGnome memory gnome = _gnomesTemplatesContract.getGnomeTemplateRarityAndRandom(rarityIndex, randomNumber);
            _createGnome(gnome.id, 1, gnome.rarity, gnome.collection);
        }
    }

    function mergeGnomes(uint tokenId1, uint tokenId2) external nonReentrant {

        require(_msgSender() == ownerOf(tokenId1) && _msgSender() == ownerOf(tokenId2), "Owner only");
        require(_playersGnomes[tokenId1].exists && _playersGnomes[tokenId2].exists, "Gnome does not exists");
        require(_playersGnomes[tokenId1].gnomeId == _playersGnomes[tokenId2].gnomeId, "Different gnome");
        require(_playersGnomes[tokenId1].level == _playersGnomes[tokenId2].level, "Different level");
        require(_playersGnomes[tokenId1].level < 10, "Max level");

        uint8 newLevel = _playersGnomes[tokenId1].level + 1;

        _burn(tokenId1);
        _burn(tokenId2);

        _createGnome(
            _playersGnomes[tokenId1].gnomeId,
            newLevel,
            _playersGnomes[tokenId1].rarity,
            _playersGnomes[tokenId1].collection
        );

    }

    function getGnomePrice(uint8 amountToBuy) public view returns (uint) {
        uint foundGnomes = _playersGnomes.length;
        uint totalPrice;
        for (uint8 i; i < amountToBuy; i++) {
            if (foundGnomes < 10000) {
                foundGnomes = foundGnomes + 1;
                continue;
            }
            totalPrice = totalPrice + (10 ** 17) * 5 * (foundGnomes / (10 ** 5) + 1);
            foundGnomes = foundGnomes + 1;
        }
        return totalPrice;
    }

    function getGnome(uint tokenId) external view returns (uint8, uint8, uint8, uint, bool) {
        require(_playersGnomes[tokenId].exists, "not exists");
        return (_playersGnomes[tokenId].gnomeId, _playersGnomes[tokenId].level, _playersGnomes[tokenId].rarity, _playersGnomes[tokenId].collection, _playersGnomes[tokenId].exists);
    }

    function _createGnome(uint8 gnomeId, uint8 level, uint8 rarity, uint collection) private {
        uint newTokenId = _playersGnomes.length;
        _safeMint(_msgSender(), newTokenId);
        structPlayerGnome memory playerGnome = structPlayerGnome({
        gnomeId : gnomeId,
        tokenId : newTokenId,
        level : level,
        rarity : rarity,
        collection : collection,
        exists : true
        });
        _playersGnomes.push(playerGnome);

        emit Mint(_msgSender(), newTokenId, playerGnome.collection, playerGnome.gnomeId, playerGnome.level, playerGnome.rarity);

    }

    function _getRarityByPosition(uint position) private view returns (uint8){

        uint supply;
        for (uint8 i = 3; i >= 0; i--) {
            supply = supply + _supplyLeft[i];
            if (supply > position) {
                return i;
            }
        }
        revert("No more supply");
    }

    function totalSupplyLeft() public view returns (uint supply){
        for (uint8 i; i < _supplyLeft.length; i++) {
            supply = supply + _supplyLeft[i];
        }
        return supply;
    }


    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function _burn(uint256 tokenId) internal override {
        super._burn(tokenId);
        _playersGnomes[tokenId].exists = false;
    }


    function _baseURI() internal view override returns (string memory) {
        return _baseURIStr;
    }

    //********************************* management functions *************************************//


    function setBaseUri(string memory uri) public onlyAdmin {
        _baseURIStr = uri;
    }

    function setRandomContractAddress(address randomContract) public onlyAdmin {
        _randomContract = IRandom(randomContract);
    }

    function setGnomesTemplateContractAddress(address gnomesTemplatesContract) public onlyAdmin {
        _gnomesTemplatesContract = IGnomesTemplates(gnomesTemplatesContract);
    }


}
